import React, {Component} from 'react'
import UserLoggedTabs from '../layout/UserLoggedTabs';

class CreateHotel extends Component {
    
    state = {

    }

    handleSubmit = (e) => {
        e.preventDefault();
    }

    render() {
        return (
            <div>
                <UserLoggedTabs></UserLoggedTabs>
                <div className="container">
                    <form className="white" onSubmit={this.handleSubmit} >
                        <h2 className="red-text lighten-1 center">Dodavanje novog hotela</h2>
                        <div className="container">
                            <div className="input-field">
                                <label htmlFor="ime">Ime:</label>
                                <input type="text" id='ime' />
                            </div>     
                            <div className="input-field">
                                <label htmlFor="adresa">Adresa:</label>
                                <input type="text" id='adresa'/>
                            </div> 
                            <div className="input-field">
                                <label htmlFor="adresa">Promotivni opis:</label>
                                <input type="text" id='adresa'/>
                            </div> 
                            <div className="input-field">
                                <button className="btn blue lighten-1 z-depth-0">Dodaj</button>
                             </div>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
};

export default CreateHotel;
